import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'

const CreateMovie = () => {
    return(
    <div>
        <Navbar />
        <Sidebar input={sidebar_options}/>
    </div>
    );
}

const sidebar_options = {
    block1: {
        title: "Add Movie",
        subtitle: "Options"
    }
}


export default CreateMovie
